import { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate, useParams } from 'react-router-dom';

function EditEvents() {
  
  const [eventData, setEventData] = useState({});

  let navigate = useNavigate();

  let { event_id } = useParams();

  useEffect(() => {
    axios
      .get("http://localhost:4580/api/readEvent")
      .then((response) => {
        setEvents(response.data.data);
      })
      .catch((error) => {
        console.error("error getting EventList", error);
      });
  }, []);

  const updateEvent = async (event) => {
    try {
      const response = await axios.put(
        `http://localhost:4580/api/updateEvent/${event._id}`,
        event
      );
      setEvents(response.data.data);
      console.log("Event updated successfully:", response.data.data);
    } catch (error) {
      console.log("Error updating event", error);
    }
  };

  const handleEdit = (event) => {
    setEventData(event);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    updateEvent(eventData);
  };

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <table>
          <tbody>
            <tr>
              <td><label>Title:</label></td>
              <td> <input
                type="text"
                value={eventData.title}
                onChange={(e) => setEventData({ ...eventData, title: e.target.value })}
              /></td>
            </tr>

            <tr>
              <td><label>Date:</label></td>
              <td> <input
                type="date"
                value={eventData.date}
                onChange={(e) => setEventData({ ...eventData, date: e.target.value })}
              />
            </td>
            </tr>

            <tr>
              <td><label>Time:</label></td>
              <td> <input
                type="time"
                value={eventData.time}
                onChange={(e) => setEventData({ ...eventData, time: e.target.value })}
              />
             </td>
            </tr>

            <tr>
              <td><label>Location:</label></td>
              <td><input
                type="text"
                value={eventData.location}
                onChange={(e) => setEventData({ ...eventData, location: e.target.value })}
              />
            </td>
            </tr>

            <tr>
              <td><label>Description:</label></td>
              <td><input
                type="text"
                value={eventData.description}
                onChange={(e) => setEventData({ ...eventData, description: e.target.value })}/>
              </td>
              </tr>
              <tr>
               <td><button type="submit">Edit Event</button></td>
            </tr>
            <tr>
              <td><button onClick={() => handleEdit(event)}>Edit</button></td>
            </tr>

            </tbody>
            </table>
            </form>
            </div>
  )
}

export default EditEvents;
